            <Messages />
          </Route>
          <Route path="/notifs">
            <Notifs />
          </Route>
          <Route path="/settings">
            <Settings />
          </Route>
          <Route path="/search">
            <Search />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/register">
            <Register />
          </Route>

        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
